import Hello from './Hello';
import {useState} from 'react';

function App() {
  const [counter, setCounter ] = userState(15)

  // let counter = 2;

  const addValue = () => {
    counter += 1;
    console.log(counter);
  }

  return (
    <>
      <h1 className="title">Counter value: {counter}</h1>

      <button
        onClick = {addValue}>
        Add value </button>

      <br/>

      <button> Subtract value </button>
    </>
  );
}

export default App;
